import React from 'react'

const Login =()=>{
    return(
        <div className="card">
        <h2>Instagram</h2>
        <input type="text" placeholder="email" />
        <input type="password" placeholder="password" />
        <button class="btn waves-effect waves-light" type="submit" name="action">Submit</button>
      </div>
    )
}
export default Login;
